import React from 'react'
import Pizzaleft from '../assets/pizzaleft.jpg'

function Contact() {
  return (
    <div className='contact'>
      <div className='leftSide' style={{ backgroundImage: `url(${Pizzaleft})` }}></div>
      <div className='rightSide'></div>

    </div>
  )
}

export default Contact
